USE hrm;

CREATE TABLE `tb_menu_access_admin` (
  `tbmaa_id` int(11) NOT NULL AUTO_INCREMENT,
  `tbm_id` int(11) DEFAULT NULL,
  `tbaug_id` int(11) DEFAULT NULL,
  `tbmaa_enabled` int(11) DEFAULT NULL,
  `tbmaa_insert` int(11) DEFAULT NULL,
  `tbmaa_update` int(11) DEFAULT NULL,
  `tbmaa_delete` int(11) DEFAULT NULL,
  `tbmaa_view` int(11) DEFAULT NULL,
  `tbmaa_approve` int(11) DEFAULT NULL,
  PRIMARY KEY (`tbmaa_id`),
  KEY `tbmaa_fk_1` (`tbm_id`),
  KEY `tbmaa_fk_2` (`tbaug_id`),
  CONSTRAINT `tbmaa_fk_1` FOREIGN KEY (`tbm_id`) REFERENCES `tb_menu` (`tbm_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `tbmaa_fk_2` FOREIGN KEY (`tbaug_id`) REFERENCES `tb_admin_user_groups` (`tbaug_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2892 DEFAULT CHARSET=latin1;


